import React, { useState } from 'react';
import firebase from '../Firebase';
import { Link, withRouter } from 'react-router-dom';


function HomePage(props) {
  const { classes } = props

  return (
    <main>
      <p>Hola</p>

      <Link to="/dashboard">
      <button
        type="submit"
        className="">
          OJO OJO
      </button>
      </Link>

      <button
        type="submit"
        component={Link}
        to="/register"
        className="">
          Registrate
      </button>


    </main>
  )




}

export default withRouter(HomePage);
